import React from 'react';
import Link from 'next/link';
import Head from 'next/head';
// import { Container } from './styles';
const Home = React.FC = () => {
  return (
    <div>
      <Head>
        <title>Home</title>
      </Head>
      <Link href="users">
        <a>Users</a>
      </Link>
    </div>
  )
}
export default Home;
